# SOLVED!


def candy_crush(S):
    stack = []
    min_candy_to_crush = 3  # To remove 3 candies or more

    for i, curr_char in enumerate(S):
        stack.append(curr_char)  # store the current character

        # Track the current length of stack, reason being that we need to
        # ascertain that the length of stack is at least the minumim amount
        # of candy to crush.
        stack_len = len(stack)

        # To crush, the length of stack must be at least the minumim amount
        # of candy to crush.
        if stack_len >= min_candy_to_crush:
            # All the element on the top of the stack which length of
            # min_candy_to_crush.
            group_min_to_crush = stack[stack_len-min_candy_to_crush:stack_len]

            # To later determine if the "group_min_to_crush" are the same.
            unique_1 = set(group_min_to_crush)

            # Look at the next charcter in the string
            next_char = "".join(S[i+1:i+2])

            # We can only start removing characters from the stack when
            # 1. The current character is not equal to the next character
            #    e.g s = "abbbbc".
            #       We don't want to start popping from the stack at index 3
            # 2. len(unique_1) == 1 and curr_char in unique_1,
            #    tells us that the current character must be equal to all the
            #    first "min_candy_to_crush" characters.
            if curr_char != next_char and len(unique_1) == 1 and \
                    curr_char in unique_1:

                # Keep removing element from the stack until the top char is
                # different
                while stack and stack[-1] == curr_char:
                    stack.pop()

    return "".join(stack)


if __name__ == "__main__":
    print(f'"{candy_crush("aabbccddeeedcba")}"')
    assert candy_crush("aabbccddeeedcba") == ""

    assert candy_crush("aaabbbc") == "c"
    print(f'"{candy_crush("aaabbbc")}"')

    assert candy_crush("aabbbacd") == "cd"
    print(f'"{candy_crush("aabbbacd")}"')

    print(f'"{candy_crush("baaabbbabbccccd")}"')
    assert candy_crush("baaabbbabbccccd") == "abbd"

    assert candy_crush("aaa") == ""
    print(f'"{candy_crush("aaa")}"')

    assert candy_crush("a") == "a"
    print(f'"{candy_crush("a")}"')

    assert candy_crush("") == ""
    print(f'"{candy_crush("")}"')

    assert candy_crush("aaabbab") == "bbab"
    print(f'"{candy_crush("aaabbab")}"')

    assert candy_crush("bbbbbbb") == ""
    print(f'"{candy_crush("bbbbbbb")}"')

    assert candy_crush("aaabbbacd") == "acd"
    print(f'"{candy_crush("aaabbbacd")}"')

    assert candy_crush("ccddccdcaacabbbaaccaccddcdcddd") == ""
    print(f'"{candy_crush("ccddccdcaacabbbaaccaccddcdcddd")}"')

    assert candy_crush("abcdefghiaaa") == "abcdefghi"
    print(f'"{candy_crush("abcdefghiaaa")}"')

